diff --git a/Objects/abstract.c b/Objects/abstract.c
index f6647874d73..e157c131c8c 100644
--- a/Objects/abstract.c
+++ b/Objects/abstract.c
@@ -2234,9 +2234,14 @@ PySequence_Count(PyObject *s, PyObject *o)
 int
 PySequence_Contains(PyObject *seq, PyObject *ob)
 {
+    if (seq == NULL) {
+        PyErr_SetString(PyExc_SystemError, "NULL sequence object");
+        return -1;
+    }
     PySequenceMethods *sqm = Py_TYPE(seq)->tp_as_sequence;
     if (sqm != NULL && sqm->sq_contains != NULL) {
-        int res = (*sqm->sq_contains)(seq, ob);
+// FIXME: Crash CWE-476: NULL Pointer Dereference
+         int res = (*sqm->sq_contains)(seq, ob);
         assert(_Py_CheckSlotResult(seq, "__contains__", res >= 0));
         return res;
     }
